public class uc_call
{
    public static void uc_add(Grid grd, UserControl uc)
    {
        if (grd.Children.Count > 0)
        {
            grd.Children.Clear();
            grd.Children.Add(uc);
        }
        else
        {
            grd.Children.Add(uc);
        }
    }
}
	
